• Core elements: subject (a nude blonde woman with translucent wings on her back) + setting (a magical forest at dawn, moss-covered stones + unopened flower buds) + motion (reaching out to cast a spell / petals unfurling)  
• Aesthetic controls: light source (dawn light, soft light), light type (rim light, outlining the fairy wings), shot size (medium-close), composition (central composition), color tone (warm tones, petals pale pink-white + wing reflections)  
• 5-second action breakdown:  
0–2 s: She crouches before a bud, palms facing the bud, a faint green glow emanating from her hands;  
2–4 s: The bud slowly opens from the top, pink petals curling upward, the yellow stamen of the flower revealed;  
4–5 s: Dew on the petals refracts the morning light, she lightly touches the flower’s center, and her wings flutter gently.
